import React from 'react'
import { Container, Navbar } from 'react-bootstrap';

function AdminNavbar() {
    return (
        <Navbar>
            <Container>
                <Navbar.Brand href="/">User</Navbar.Brand>
                <Navbar.Toggle />
                <Navbar.Collapse className="justify-content-end">

                </Navbar.Collapse>
            </Container>
        </Navbar>
    )
}

export default AdminNavbar
